import { BrowserRouter, Route, Switch } from 'react-router-dom';
import { lazy, Suspense } from 'react';
import { InitApp } from 'helpers/InitApp';

const appIcon = ()=>{
    return "data:image/gif;base64,"
}


const Tabs = lazy(() => import('components/common/Tabs'));
const AddNew = lazy(() => import('pages/AddNew'));
const Messenger = lazy(() => import('pages/Messenger'));

const PostDetails = lazy(() => import('components/Post/PostDetails'));

const LogIn = lazy(() => import('pages/Authentication/LogIn'));
const SignUp = lazy(() => import('pages/Authentication/SignUp'));
const NotFound = lazy(()=> import('pages/NotFound'));

function App() {

    InitApp();
    return (
        <BrowserRouter>
            <div className="App">
                <Suspense fallback={
                    <div className='loading'>
                        <img src={appIcon()} alt="app-icon" width='50px' />
                        <h1 className='logo-text'>Minsta</h1>
                    </div>
                }>
                    <Switch>
                        <Route exact path={['/', '/explore', '/reels', '/notif', '/user']}><Tabs /></Route>

                        <Route exact path='/add-new'><AddNew /></Route>
                        <Route exact path='/messenger'><Messenger /></Route>
                        <Route exact path='/post/:id'><PostDetails /></Route>

                        <Route exact path='/login'><LogIn /></Route>
                        <Route exact path='/signup'><SignUp /></Route>
                        <Route path='*'><NotFound /></Route>
                    </Switch>
                </Suspense>
            </div>
        </BrowserRouter>
    );
};
export default App;